import React from "react";

const ImageChange = () => {
  return (
    <div>
      <img
        src="https://i.imgur.com/WomlR1v.jpg"
        alt="dog-with-mask"
        width="500px"
        height="500px"
      />
      &nbsp;&nbsp;&nbsp;
      <img src="" alt="" />
    </div>
  );
};

export default ImageChange;
